import React, {useEffect, useState} from 'react'
import "../CSS/main.css";
import Header from './Header';

function Main() {

  const [elderData, setElderData] = useState([{}])
  const sessionData = sessionStorage.getItem("UserSession");
  useEffect(()=>{
    
    var userId = JSON.parse(sessionData)
   

      console.log(userId["user_id"]);
      fetch(`/api/caregivers/${userId["user_id"]}/elder-list`)
      .then(response => response.json())
      .then(elders => {
        setElderData(elders);
        console.log(elderData); // Do something with the retrieved car list
      })
      .catch(error => console.error(error));
    
    
  }, [])
  
  const ElderDetails = ({ name, sirname, address }) => {
    return (
      <div className="elder-details">
               <Header />
        <h2>{name} {sirname}</h2>
        <p>{address}</p>
      </div>
    );
  };

  return (
    <div className="back">
      {elderData.map((person, index) => (
        <ElderDetails
          key={index}
          name={person.name}
          sirname={person.sirname}
          address={person.address}
        />
      ))}
    </div>
  )
}

export default Main
